First step is plugin initialization. In your rust project, you will need to initialize Crossbow instance and then get Android plugin: #![cfg(target_os = "android")] use crossbow::android::*;
let crossbow = CrossbowInstance::new();
let play_core: play_core::PlayCorePlugin = crossbow.get_plugin()?; After plugin initialization you can use supported features. For example to start connection and query purchases you can use: play_core.check_update()?;
play_core.in_progress_update()?; To read signals that plugin returns: if let Ok(signal) = play_core.get_receiver().recv().await { println!("Signal: {:?}", signal);
} Complete documentation of plugin you can find here .

