Let's build and run this application. Android command below will generate gradle project and install apk on your device. See crossbundle run command for additional information. crossbundle run android But to be able to test In-app updates - you will need to publish your application to Play Store as Internal testing or any other (Closed testing or Production, etc.). To publish your app to Play Store - you will want to export gradle project with this command: crossbundle build android --export-path=./path/ Then in generated project add signing to build.gradle like this: signingConfigs { release { if (project.hasProperty('MYAPP_UPLOAD_STORE_FILE')) { storeFile file(MYAPP_UPLOAD_STORE_FILE) storePassword MYAPP_UPLOAD_STORE_PASSWORD keyAlias MYAPP_UPLOAD_KEY_ALIAS keyPassword MYAPP_UPLOAD_KEY_PASSWORD } }
}
buildTypes { release { signingConfig signingConfigs.release }
} and in gradle.properties actual values: MYAPP_UPLOAD_STORE_FILE=my-project.keystore
MYAPP_UPLOAD_KEY_ALIAS=my-project
MYAPP_UPLOAD_STORE_PASSWORD=123456
MYAPP_UPLOAD_KEY_PASSWORD=123456 You can read more here , and here .

